  [],\n\t\"revision_timestamp\": \"2015-08-21T07:32:17.751392\",\n\t\"name\": \"deer-herd-health-check-at-hillside-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This population appears to be near nutritional
  carrying capacity based on the moderately high APC value, the levels of other parasites
  and pathologic conditions, and the general physical parameters of the animals. Currently,
  the herd does not appear to have any significant density related health problems,
  and we did not encounter any overtly diseased deer. The herd has moderate immunity
  to epizootic hemorrhagic disease viruses, but prediction of future activity by the
  hemorrhagic viruses is not possible. Our data indicate that the herd can be maintained
  near its present density without undue risk of declines in herd health provided
  that habitat quality remains stable. Any significant increase in density can be
  expected to be accompanied by problems with a syndrome of parasitism and malnutrition.
  The physical parameters for this population are generally lower than those for the
  Yazoo National Wildlife Refuge animals, and my explanation for this is the higher
  soil fertility and more extensive availability of agricultural crops at Yazoo National
  Wildlife Refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
